import "./HotelImages.css"
export const HotelImages = ({singleHotel})=>{

     const {image,imageArr} = singleHotel;

    return(
        <div className="hotel-image-container shadow cursor-pointer">
            <div className="primary-image-container">
                <img className="hotel-imf primary-img"src={image} alt ="primary-image"/>

            </div>
            <div className="d-flex wrap gap-smalll">
                {
                    imageArr && imageArr.map(image => <img key={image}className="hotel-img" src={image} alt="hotel-image"/>)
                }
            </div>
        </div>
    )
}
